        setRangeSpan(editable, wordStart, end);
    } else {
        if (DBG && scheduleOtherSpellCheck) {
            Log.w(TAG, "Trying to schedule spellcheck for invalid region, from " + wordStart + " to " + end);
        }
        removeRangeSpan(editable);
    }
    spellCheck();
}

